            <section class="container" style={{ marginTop: "-120px", display: "flex", justifyContent: "space-between", alignItems: "center", marginBottom: '20px' }}>
                <div class="row imagelist">
                    {activeImageListData.map(res => (
                        <div class="col-md-4"
                            onClick={() => {
                                RedirectThemePage(res.id);
                                setId(res.id);
                            }}
                            style={{ marginBottom: "30px" }}>
                            <div class="card" style={{ height: "100%" }}>
                                <img class="card-img-top" src={res.filename} alt="Card image cap" style={{ height: "260px", border: "5px solid white" }} />
                                <div class="card-body">
                                    <h5 class="card-title">{res.caption}</h5>
                                    <h5 class="card-title">{res.countryname}</h5>
                                </div>
                                <div class="card-body">
                                    <div class="row">
                                        <div class="col-md-6">
                                            <p>Tour ID</p>
                                        </div>
                                        <div class="col-md-6">
                                            <p>{res.id}</p>
                                        </div>
                                    </div>
                                    <div class="row">
                                        <div class="col-md-6">
                                            <p>MLS</p>
                                        </div>
                                        <div class="col-md-6">
                                            <p>{res.mls}</p>
                                        </div>
                                    </div>
                                    <div class="row">
                                        <div class="col-md-6">
                                            <p>Price</p>
                                        </div>
                                        <div class="col-md-6">
                                            <p>{res.price}</p>
                                        </div>
                                    </div>
                                    <div class="row">
                                        <div class="col-md-6">
                                            <p>Status</p>
                                        </div>
                                        <div class="col-md-6">
                                            <p>{res.categoryname}</p>
                                        </div>
                                    </div>
                                    <div class="row">
                                        <div class="col-md-6">
                                            <p>Beds</p>
                                        </div>
                                        <div class="col-md-6">
                                            <p>{res.Beds}</p>
                                        </div>
                                    </div>
                                    <div class="row">
                                        <div class="col-md-6">
                                            <p>Baths</p>
                                        </div>
                                        <div class="col-md-6">
                                            <p>{res.Baths}</p>
                                        </div>
                                    </div>
                                </div>
                            </div>
                        </div>
                    ))}
                </div>
            </section>


            <Dialog maxWidth={maxWidth} fullWidth={true} onClose={handleClose} aria-labelledby="customized-dialog-title" open={openAgentinfo}>
                <DialogTitle id="customized-dialog-title" >
                    Amenities
